  "text" : "\uD55C\uB54C\uB294 \uD53C\uB97C \uD314\uC544\uC11C \uBC30\uB97C \uCC44\uC6B0\uB358 \uC2DC\uC808\uC774 \uC788\uC5C8\uB2E4. \uADF8\uB7F0\uB370 \uC9C0\uAE08\uC740 \uD5CC\uD608\uC790\uB294 \uC9C0\uC18D\uC801\uC73C\uB85C \uC904\uC5B4\uB4E4\uACE0 \uC788\uB2E4. \uD5CC\uD608\uC5D0 \uB300\uD55C \uC545\uC18C\uBB38\uC774 \uB04A\uC774\uC9C0 \uC54A\uB294 \uAC83\uB3C4 \uBB38\uC81C, \uC801\uC2ED\uC790\uC758 \uC548\uC77C\uD55C \uD608\uC561\uAD00\uB9AC\uB3C4 \uD55C\uBAAB.. \uD608\uC561\uC774\uB780 \uC720\uD1B5\uAE30\uD55C\uC774 \uC788\uAE30 \uB54C\uBB38\uC5D0 \uC548\uC815\uC801 \uC218\uAE09\uC774 \uBC18\uB4DC\uC2DC \uD544\uC694\uD558\uB2E4.",
