  "text" : "\uD558\uC9C0\uB9CC \uB300\uAE30\uC5C5 \uB618\uB9C8\uB2C8\uB294 \uD578\uB4DC\uC544\uC6C3\uC744 \uC8FC\uC9C0 \uC54A\uC73C\uBA74 \uC0AC\uB78C\uC744 \uAC1C\uBB34\uC2DC\uD55C\uB2E4. RT @in_future: \uD504\uB9AC\uC820\uD14C\uC774\uC158 \uD301 3. \uD578\uB4DC\uC544\uC6C3\uC744 \uB098\uB220\uC8FC\uC9C0 \uB9D0\uB77C. \uD654\uBA74\uC5D0 \uC9D1\uC911\uC744 \uC548\uD558\uAE30\uB54C\uBB38\uC774\uB2E4. \uC918\uC57C\uD55C\uB2E4\uBA74 \uBC1C\uD45C \uB05D\uB098\uACE0 \uC9C8\uBB38\uC2DC\uAC04\uC5D0 \uC8FC\uACA0\uB2E4\uACE0 \uC591\uD574\uB97C \uAD6C\uD558\uB77C",
