  "text" : "\uBD84\uB178\uC640 \uD655\uC2E0\uC740 \uBE44\uB840\uAD00\uACC4\uC5D0 \uC788\uC2B5\uB2C8\uB2E4. \uC124\uB4DD\uC758 \uACFC\uC815\uC5D0\uC11C \uC0C1\uB300\uBC29\uC744 \uBD84\uB178\uD558\uAC8C \uD55C\uB2E4\uBA74 \uC0C1\uB300\uBC29\uC740 \uC790\uC2E0\uC774 \uD2C0\uB838\uB2E4\uB294 \uC0AC\uC2E4\uC870\uCC28 \uC9C4\uC2E4\uB85C \uACE0\uC815\uC2DC\uD0A4\uB294 \uACBD\uD5A5\uC774 \uC788\uC2B5\uB2C8\uB2E4. \uADF8\uB7F0\uB370 \uC6B0\uB9AC\uB294 \uB9CE\uC740 \uACBD\uC6B0 \uC790\uC2E0\uC774 \uC633\uB2E4\uACE0 \uD558\uBA74\uC11C \uC0C1\uB300\uBC29\uC744 \uBD84\uB178\uCF00 \uD569\uB2C8\uB2E4.",
