  "geo" : { },
  "id_str" : "6645869891",
  "text" : "\uC774\uBC88 \uC8FC\uB9D0 \uCBE4 \uB418\uBA74 \uB610 \uBAB0\uC544\uC11C \uBE14\uB85C\uADF8\uC5D0 \uBA87\uAC00\uC9C0 \uAE00\uC744 \uD3EC\uC2A4\uD305 \uD560 \uAC83 \uAC19\uC2B5\uB2C8\uB2E4. \uD2B8\uC704\uD130\uB294 \uBA54\uBAA8\uC7A5\uC73C\uB85C \uC720\uC6A9\uD55C\uB4EF \uD558\uC9C0\uB9CC.. \uB098\uC911\uC5D0 \uB2E4\uC2DC \uC815\uBCF4\uB97C \uCDE8\uD569\uD558\uAE30 \uC704\uD574 \uB3CC\uC544\uBCF4\uBA74 \uC5F0\uACB0\uACE0\uB9AC\uAC00 \uB9CE\uC774 \uC57D\uD55C \uAC83\uC774.. \uBA3C\uAC00 \uC88B\uC740 \uBA54\uBAA8\uB3C4\uAD6C\uB97C \uC0DD\uAC01\uD574 \uB0B4\uC57C\uD560 \uAC83 \uAC19\uC2B5\uB2C8\uB2E4.",
