  "id_str" : "6645914845",
  "text" : "\uC800\uB294 \uD14C\uC2A4\uD2B8 \uD074\uB9AC\uB2C9\uC758 \uAC00\uC815\uC758\uAC00 \uB418\uACE0 \uC2F6\uC2B5\uB2C8\uB2E4. \uB9CE\uC740 \uC0AC\uB78C\uB4E4\uC774 \uC81C \uBE14\uB85C\uADF8\uC5D0 \uD14C\uC2A4\uD305\uC5D0 \uB300\uD55C \uC2E4\uC81C\uC801\uC778 \uACBD\uD5D8\uC0AC\uB840\uB098 \uC720\uC6A9\uD55C \uB3C4\uAD6C \uC0AC\uC6A9. \uAE30\uBC95\uB4E4\uC774 \uC5C6\uB2E4\uACE0 \uC0DD\uAC01\uD558\uC2DC\uB294\uB370.. \uC804 \uADF8\uB7F0 \uC804\uBB38\uC758\uC640\uB294 \uC880 \uAC70\uB9AC\uAC00 \uC788\uC2B5\uB2C8\uB2E4. \uC804 \uC804\uCCB4\uB97C \uBCFC \uC218 \uC788\uB294 \uAC00\uC815\uC758\uC5D0 \uAC00\uAE5D\uC2B5\uB2C8\uB2E4.",
