  "text" : "\uC0AC\uB78C\uB4E4\uC740 \uB2E8\uC21C\uC131\uC5D0 \uB300\uD558\uC5EC \uB9CE\uC740 \uC624\uD574\uB97C \uD558\uACE0 \uC788\uC2B5\uB2C8\uB2E4. \uB2E8\uC21C\uD568\uC774\uC57C\uB9D0\uB85C \uAC00\uC7A5 \uAC15\uB825\uD55C \uD798\uC785\uB2C8\uB2E4. \uD558\uC9C0\uB9CC \uC0AC\uB78C\uB4E4\uC740 \uB2E8\uC21C\uD568\uC744 \uC0C1\uC2DD\uC73C\uB85C \uC624\uD574\uD558\uACE0 \uC788\uC8E0. \uB2F9\uC2E0\uC740 \uC815\uB9D0 \uB2E8\uC21C\uD568\uC774 \uBB34\uC5C7\uC778\uC9C0 \uC54C\uACE0 \uACC4\uC2DC\uB098\uC694?",
